defs.script:
function viewVersion9() {
  var grbl9 = document.getElementById("endstop_gr9");
  var grbl89 = document.getElementById("endstop_gr89");
  var activeColor = document.getElementById("bt_bg_9");
  var inactiveColor = document.getElementById("bt_bg89");
  grbl9.style.display = "block";
  grbl89.style.display = "none";
  activeColor.style.fill = "#15c944";
  activeColor.style.stroke = "#16a53b";
  inactiveColor.style.fill = "#3b5958";
  inactiveColor.style.stroke = "#324682";
}
function viewVersion89() {
  var grbl9 = document.getElementById("endstop_gr9");
  var grbl89 = document.getElementById("endstop_gr89");
  var activeColor = document.getElementById("bt_bg89");
  var inactiveColor = document.getElementById("bt_bg_9");
  grbl9.style.display = "none";
  grbl89.style.display = "block";
  activeColor.style.fill = "#15c944";
  activeColor.style.stroke = "#16a53b";
  inactiveColor.style.fill = "#3b5958";
  inactiveColor.style.stroke = "#324682";
}
